const defaultMaterialTheme = createTheme();
const getMuiTheme = () =>
  createTheme({
    overrides: {
      MuiTableCell: {
        root: {
          '@media (max-width:959.95px)': {
            borderBottom: 'none',
            padding: '1px',
          },
        },
      },
      MUIDataTableBodyCell: {
        stackedCommon: {
          '@media (max-width:959.95px)': {
            whiteSpace: 'normal',
            height: '100%',
            paddingLeft: '5px',
            display: 'inherit',
          },
        },
        cellHide: {
          fontWeight: 'bold',
          paddingTop: '15px',
        },
      },
      MuiTableRow: {
        root: {
          borderBottom: '1px solid rgba(224, 224, 224, 1)',
        },
      },
    },
  });

const muiOptions = {
  search: true,
  download: true,
  print: true,
  viewColumns: true,
  filter: true,
  filterType: 'dropdown',
  responsive: 'vertical',
  setTableProps: () => ({ size: 'small' }),
};

const materialOptions = {
  grouping: true,
  search: true,
  selection: true,
  exportButton: true,
  filtering: true,
  sorting: true,
  fixedColumns: {
    left: 0,
    right: 0,
  },
};

const ChartData = ({ payItem, title, chartType }) => {
  console.log(title);
  const data =
    payItem &&
    payItem.result &&
    payItem.result.length > 0 &&
    payItem.result.map((item) => {
      return {
        type: item.EmpCode || item.Emp_Code,
        value: item.LastPay || item.Region_Name,
        payType: item.PayheadName || item.Designation_Name,
      };
    });

  const chartConfig = {
    data,
    isStack: true,
    //isGroup: true,
    xField: 'type',
    yField: 'value',
    seriesField: 'payType',
    groupField: 'payType',
    angleField: 'value',
    colorField: 'type',
    label: {
      position: 'middle',
      layout: [
        {
          type: 'interval-adjust-position',
        },
        {
          type: 'interval-hide-overlap',
        },
        {
          type: 'adjust-color',
        },
      ],
      style: {
        fill: '#FFFFFF',
        opacity: 0.6,
      },
    },
    xAxis: {
      label: {
        autoHide: true,
        autoRotate: false,
      },
    },
  };

  return <div>{chartType === 'pie' ? <Pie {...chartConfig} /> : <Column {...chartConfig} />}</div>;
};

const RenderData = ({ data, cmbType, title, loading }) => {
  /* Object Structure
  AvgValue:13444
  CTC:0
  CreatedBy:"SMS1018"
  CreatedOn:"2023-06-18T09:29:15.613Z"
  EmpCode:"1110007"
  FirstQuartile: 13444
  FourthQuartile: 0
  IQRange: -20166
  LastPay: 13444
  LowerBound: 33610
  MaxValue: 13444
  MinValue: 13444
  PayArray: "13444.00, 13444.00"
  PayCount: 2
  PayCycle: "50"
  PayheadName: "BASIC"
  SecondQuartile: 13444
  ThirdQuartile: 0
  UpperBound: -20166
  */
  // Loop through the data and create two objects named columns and data for the MUIDataTable. columns is an array of strings and data is an array of arrays.
  // Columns are arrays of strings from the keys of the first object in the data array.
  // Data is an array of arrays from the values of the objects in the data array.

  var columns = [];
  var tableData = [];
  console.log('RENDERDATA', data);
  if (data && data.result && data.result.length > 0) {
    columns = Object.keys(data.result[0]);
    tableData = data.result.map((item) => Object.values(item));
  }
  return (
    <Row>
      <Col span={24}>
        <MuiThemeProvider theme={getMuiTheme()}>
          <MUIDataTable
            loading={loading}
            title={title}
            data={tableData}
            columns={columns}
            options={muiOptions}
            responsive={'vertical'}
          />
        </MuiThemeProvider>
      </Col>
    </Row>
  );
};

